import React, { Component } from "react";
import RentalItem from "./RentalItem";

class RentalList extends Component {
  constructor(props) {
    super(props);

    this.state = {};
  }

  render() {
    return (
      <div>
        <div className="container__title">Places to stay around the world</div>
        <br />
        <div className="row">
          <div className="col-sm">
            <RentalItem />
          </div>
          <div className="col-sm">
            <RentalItem />
          </div>
          <div className="col-sm">
            <RentalItem />
          </div>
        </div>
      </div>
    );
  }
}

export default RentalList;
